import React, { Component } from "react";

class Customers extends Component {
  constructor(props) {
    super(props);
    this.state = {
      customers: [
        {
          cid: 1,
          cname: "Prayuj Pillai",
          email: "prayuj@gmail.com",
          membershipJoinDate: "2019-02-16",
          membershipEndDate: "2020-02-16"
        },
        {
          cid: 2,
          cname: "Olivia Dsa",
          email: "oliviadsa@gmail.com",
          membershipJoinDate: "2018-05-12",
          membershipEndDate: "2018-11-12"
        },
        {
          cid: 3,
          cname: "Sagar Rao",
          email: "sagarrao@gmail.com",
          membershipJoinDate: "2019-02-16",
          membershipEndDate: "2020-02-16"
        },
        {
          cid: 4,
          cname: "Denzil Dsouza",
          email: "denzildsouza@gmail.com",
          membershipJoinDate: "2019-02-16",
          membershipEndDate: "2020-02-16"
        },
        {
          cid: 5,
          cname: "Denver Dsouza",
          email: "denver@gmail.com",
          membershipJoinDate: "2019-02-16",
          membershipEndDate: "2020-02-16"
        },
        {
          cid: 6,
          cname: "Sherman Sequeria",
          email: "shermansequeria@gmail.com",
          membershipJoinDate: "2019-02-16",
          membershipEndDate: "2020-02-16"
        }
      ]
    };
  }
  render() {
    return (
      <div>
        <table className="table" style={{ marginTop: 20 }}>
          <thead>
            <tr>
              <th>Id</th>
              <th>Name</th>
              <th>Available In</th>
              <th>Status</th>
              <th>Number Available</th>
            </tr>
          </thead>
          <tbody>
            {this.state.games.map(game => (
              <Game
                id={game.id}
                name={game.name}
                availableIn={game.availableIn}
                status={game.status}
                noAvailable={game.noAvailable}
              />
            ))}
          </tbody>
        </table>
      </div>
    );
  }
}

export default Customers;
